document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll(".dropdown-trigger");M.Dropdown.init(e,{coverTrigger:!1,constrainWidth:!1,hover:!0})}),document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll(".sidenav");M.Sidenav.init(e)}),document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll(".collapsible");M.Collapsible.init(e,{onOpenStart:function(e,t){null!=e.firstElementChild.firstElementChild&&(e.firstElementChild.firstElementChild.innerHTML="arrow_drop_up")},onCloseStart:function(e,t){null!=e.firstElementChild.firstElementChild&&(e.firstElementChild.firstElementChild.innerHTML="arrow_drop_down")}})}),document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll(".carousel");M.Carousel.init(e,{fullWidth:!0,indicators:!0})});const copyBtn=Array.prototype.slice.call(document.querySelectorAll(".copyButton")),copiedText=Array.prototype.slice.call(document.querySelectorAll(".copiedText")),copyMsg=Array.prototype.slice.call(document.querySelectorAll(".copyMessage"));copyBtn.forEach((e,t)=>{e.addEventListener("click",()=>{navigator.clipboard.writeText(copiedText[t].innerText),copyMsg[t].style.opacity=1,setTimeout(()=>{copyMsg[t].style.opacity=0},2e3)})});
